import React from "react";
import "../css/Main.css";

import picture1 from "../assets/images/silhouette.jpg";
import picture2 from "../assets/images/hondaRepair.jpg";
import Map from "./Map";

const Body = () => {
  return (
    <div className="main">
      <h1>T-T Honda</h1>
      <h2>Full service car repair...specializing in Japanese cars</h2>
      <h3>---Since 2004---</h3>
      <p>
        Give us a call @ <a href="tel:+16192840050">(619)284-0050</a>{" "}
      </p>

      <p>4030 43rd Street San Diego, CA 92105</p>
      <div className="imageMapImage">
        <img src={picture1} height="200px" width="100px" alt="car on lift" />;
        <Map />
        <img src={picture2} height="200px" width="100px" alt="honda repair" />
      </div>
      <p>Full service auto repair...specializing in Japanese cars</p>
      <p>From oil changes to timing belts!</p>
      <p>Hours</p>
    </div>
  );
};

export default Body;
